import React from "react";
import { Card } from "react-bootstrap";

const BlogPost = ({ blogs }) => {
  return (
    <Card>
      <Card.Body>
        <Card.Title>{blogs.title[0]}</Card.Title>
        <Card.Subtitle className="text-muted mb-2">
          {`${blogs.author[0]} - ${blogs.date[0]}`}
        </Card.Subtitle>
        <Card.Text>{blogs.body[0]}</Card.Text>
      </Card.Body>
    </Card>
  );
};

export default BlogPost;
